import React, { useState } from "react";
import "./styles/App.css";

function App() {
  const [query, setQuery] = useState("");
  const [results, setResults] = useState([]);

  const handleSearch = async () => {
    const response = await fetch(`http://localhost:5000/search?query=${query}`);
    const data = await response.json();
    setResults(data);
  };

  return (
    <div id="app">
      <header>
        <nav className="navbar">
          <div className="logo">Intuitive Care</div>
          <ul className="nav-links">
            <li><a href="#">Início</a></li>
            <li><a href="#">Sobre</a></li>
            <li><a href="#">Serviços</a></li>
            <li><a href="#">Contato</a></li>
          </ul>
        </nav>
      </header>

      <section className="operador">
        <div className="container">
          <div className="quadrado">
            <h1>Buscar Operadoras de Saúde</h1>
            <input
              type="text"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              placeholder="Digite o nome da operadora..."
            />
            <button onClick={handleSearch}>Buscar</button>
            <ul>
              {results.map((operadora, index) => (
                <li key={index}>
                  <strong>{operadora.NOME_OPERADORA}</strong><br />
                  CNPJ: {operadora.CNPJ}<br />
                  Status: {operadora.STATUS_OPERADORA}
                </li>
              ))}
            </ul>
          </div>
        </div>
      </section>
    </div>
  );
}

export default App;
